script: |
  super -f text -I q11489.spq | sort > q11489.out

inputs:
  - name: q11489.spq
    data: |
      SELECT DISTINCT col2 FROM tab1 (FORMAT parquet) WHERE NOT NULL NOT BETWEEN NULL AND ( - col2 + - + col1 + CAST ( NULL AS REAL ) * + col1 + - 61 );
  - name: tab1

outputs:
  - name: q11489.out
    data: |
